"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F151185\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Inhibiting transport of essential elements in the fungal cell disrupting the synthesis of DNA, RNA, and protein",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F151199\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Cream, suspension: &lt;2% through intact skin; increased with gel; &lt;5% with lacquer",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Scalp application: To epidermis, corium (dermis), including hair, hair follicles, and sebaceous glands",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 94% to 98%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Biologic: Cream, suspension: 1.7 hours; Elimination: Gel: 5.5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (gel: 3% to 10%); feces (small amounts)",
"    </p>",
"   </div>",
