var title_f43_40_44682="ECG sinus rhythm WPW";
var content_f43_40_44682=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F76226%7ECARD%2F67181&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F76226%7ECARD%2F67181&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1147px;\">",
"  <div class=\"figure\" style=\"width: 561px\">",
"   <div class=\"ttl\">",
"    12-lead electrocardiogram (ECG) of a patient in sinus rhythm with Wolff-Parkinson-White (WPW) pattern",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 541px; height: 304px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Nearly full preexcitation is manifest in normal sinus rhythm on the 12 lead ECG in this patient with a short accessory pathway refractory period. The ventricular complex in preexcitation is a fusion of the impulse that preexcites the ventricles due to rapid conduction through an accessory pathway and of the impulse that takes the usual route through the AV node; this fusion creates the delta wave that is characteristic of Wolff-Parkinson-White ECG pattern.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 466px\">",
"   <div class=\"ttl\">",
"    Normal ECG",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 466px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal sinus rhythm at a rate of 71 beats/min, a P wave axis of 45&deg;, and a PR interval of 0.15 sec.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1272px;\">",
"  <div class=\"figure\" style=\"width: 558px\">",
"   <div class=\"ttl\">",
"    ECG in Wolff-Parkinson-White",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 538px; height: 365px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The 12 lead ECG shows the typical features of Wolff-Parkinson-White; the PR interval is short (*) and the QRS duration prolonged as a result of a delta wave (arrow), indicating ventricular preexcitation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Martin Burke, DO.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 594px\">",
"   <div class=\"ttl\">",
"    Normal ECG",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 594px; height: 337px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal electrocardiogram showing normal sinus rhythm at a rate of 75 beats/min, a PR interval of 0.14 sec, a QRS interval of 0.10 sec, and a QRS axis of approximately 75&deg;.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ary Goldberger, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
