var title_f43_40_44684="Empiric intravenous antibiotic therapy for human bite wounds";
var content_f43_40_44684=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F80019&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F80019&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Empiric intravenous antibiotic therapy for human bite wounds",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Antibiotic",
"      </td>",
"      <td class=\"subtitle1\">",
"       Dosing for adults",
"      </td>",
"      <td class=\"subtitle1\">",
"       Dosing for children",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\">",
"       Agents of choice for empiric coverage include:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2_start\" colspan=\"3\">",
"       Monotherapy with a beta-lactam/beta-lactamase inhibitor, such as one of the following:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Ampicillin-sulbactam",
"      </td>",
"      <td class=\"sublist_other\">",
"       3 g every six hours",
"      </td>",
"      <td class=\"sublist_other\">",
"       50 mg/kg per dose (based on ampicillin component) every six hours*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Piperacillin-tazobactam",
"      </td>",
"      <td class=\"sublist_other\">",
"       4.5 g every eight hours",
"      </td>",
"      <td class=\"sublist_other\">",
"       125 mg/kg per dose (based on piperacillin component) every eight hours*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Ticarcillin-clavulanate",
"      </td>",
"      <td class=\"sublist_other\">",
"       3.1 g every four hours",
"      </td>",
"      <td class=\"sublist_other\">",
"       50 mg/kg per dose (based on ticarcillin component) every four hours*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       <p>",
"        A third generation cephalosporin such as ceftriaxone",
"       </p>",
"       <p>",
"        <strong>",
"         PLUS",
"        </strong>",
"       </p>",
"       <p>",
"        Metronidazole",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        1 g every 24 hours",
"       </p>",
"       <p>",
"        <strong>",
"         PLUS",
"        </strong>",
"       </p>",
"       <p>",
"        500 mg every eight hours",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        100 mg/kg per dose every 24 hours (maximum 1 g per dose)",
"       </p>",
"       <p>",
"        <strong>",
"         PLUS",
"        </strong>",
"       </p>",
"       <p>",
"        10 mg/kg per dose every eight hours (maximum 500 mg per dose)",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\">",
"       Alternative empiric regimens include:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       <p>",
"        A fluoroquinolone such as levofloxacin",
"       </p>",
"       <p>",
"        <strong>",
"         PLUS",
"        </strong>",
"       </p>",
"       <p>",
"        Metronidazole",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        500 mg daily",
"       </p>",
"       <p>",
"        <strong>",
"         PLUS",
"        </strong>",
"       </p>",
"       <p>",
"        500 mg every eight hours",
"       </p>",
"      </td>",
"      <td>",
"       Use fluoroquinolones with caution in children &lt;18 years of age",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2_start\" colspan=\"3\">",
"       Monotherapy with a carbapenem&bull;, such as one of the following:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Imipenem-cilastatin",
"      </td>",
"      <td class=\"sublist_other\">",
"       500 mg every six hours",
"      </td>",
"      <td class=\"sublist_other\">",
"       25 mg/kg per dose every six hours (maximum 500 mg per dose)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Meropenem",
"      </td>",
"      <td class=\"sublist_other\">",
"       1 g every 8 hours",
"      </td>",
"      <td class=\"sublist_other\">",
"       20 mg/kg per dose every 8 hours (maximum 1 g per dose)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Ertapenem",
"      </td>",
"      <td class=\"sublist_other\">",
"       1 g daily",
"      </td>",
"      <td class=\"sublist_other\">",
"       15 mg/kg per dose every twelve hours for children up to 12 years of age (maximum 500 mg per dose)",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Maximum pediatric dose: see adult dose",
"     <br>",
"      &bull; Carbapenems should not be used for patients with history of immediate-type hypersensitivity to beta-lactams.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
